import React from 'react';
import './App.css';

// Import project images
import project1Image from './images/turtlebot2i_proj.png';
import project2Image from './images/turtlebot2i_proj.png';
import project3Image from './images/turtlebot2i_proj.png';

function App() {
  // Array of projects
  const projects = [
    {
      title: 'TURTLEBOT 2i AUTONOMOUS NAVIGATION AND MANIPULATION',
      description: 'Our project was to develop the autonomous navigation and manipulation features\
                     on the TurtleBot 2i. The task of this project can be divided into two parts. \
                     First part includes map construction, self-location and path planning of the \
                     TurtleBot 2i. Second part includes object identification and color sorting in \
                     computer vision, and object manipulation and fetching by robotic arms. This \
                     development can make the TurtleBot 2i be generalized to warehousing management\
                      robots in the future.',
      demoLink: 'https://turtlebot2i.weebly.com/',
      image: project1Image
    },
    {
      title: 'Project 2',
      description: 'Description of Project 2. Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
      demoLink: 'https://example.com/project2-demo',
      image: project2Image
    },
    {
      title: 'Project 3',
      description: 'Description of Project 3. Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
      demoLink: 'https://example.com/project3-demo',
      image: project3Image
    }
  ];

  return (
    <div className="App">
      <div class="robot-background"></div>
      <header>
        <h1>Jason Ramirez</h1>
        <p>Full-Stack Software Engineer</p>
      </header>

      <nav>
        <a href="#about">About</a>
        <a href="#projects">Projects</a>
        <a href="#contact">Contact</a>
      </nav>

      <section id="about">
        <h2>About Me</h2>
        <p>Add a brief description of yourself and your skills as a full-stack software engineer.</p>
      </section>

      <section id="projects">
        <h2>Projects</h2>
        <div className="project-list">
          {projects.map((project, index) => (
            <div className="project" key={index}>
              <img src={project.image} alt={project.title} />
              <div className="project-info">
                <h3>{project.title}</h3>
                <p>{project.description}</p>
                <a href={project.demoLink} target="_blank" rel="noopener noreferrer">Demo</a>
              </div>
            </div>
          ))}
        </div>
      </section>

      <section id="contact">
        <h2>Contact Me</h2>
        <p>Add your contact information, such as email address or social media profiles.</p>
      </section>

      <footer>
        &copy; {new Date().getFullYear()} Jason Ramirez
      </footer>
    </div>
  );
}

export default App;
